import React, { useState } from "react";
import NavbarItem from "./NavbarItem";

const Navbar = () => {

  const [page, setPage] = useState("TopArtists");

  const topArtistClickHanlder = () => {
    setPage("TopArtists");
  };

  const topTracksClickHanlder = () => {
    setPage("TopTracks");
  };

  const recentClickHanlder = () => {
    setPage("Recent");
  };

  const exploreClickHanlder = () => {
    setPage("Explore");
  }

  return (
    <div className="h-20 pt-5 pl-40 pr-40 py-2 px-4 grid grid-cols-4 gap-4 place-items-center">
      <NavbarItem onClick={topArtistClickHanlder} onTo="/top-artists" title="Top Artists"></NavbarItem>
      <NavbarItem onClick={topTracksClickHanlder} onTo="/top-tracks" title="Top Tracks"></NavbarItem>
      <NavbarItem onClick={recentClickHanlder} onTo="/recent" title="Recent"></NavbarItem>
      <NavbarItem onClick={exploreClickHanlder} onTo="/explore" title="Explore"></NavbarItem>
    </div>
  );
};

export default Navbar;
